INSERT INTO `catalog_product_entity_text` VALUES (1,4,72,0,1,'<h2>Information</h2>\r\n\r\nThis o-neck sweater with long sleeves is the sweater for you that don’t want to wear an oversize one, or simply want a perfect o-neck sweater that you can pair with anything. Beautiful just as it is with jeans and boots or chic tucked into a high-wasted skirt. This style is a must in any wardrobe and of course it is in 100 % cashmere. Knitted in 12 gauge and the model wears a size small and is cm. Available in many different colours perfect for fall and all year around. The model is 174 cm tall and wears a size small.\r\n\r\n<ul>\r\n<li>Worldwide Shipment</li>\r\n<li>Free Returns</li>\r\n<li>Shipped within 72 hours</li>\r\n</ul>'),(2,4,73,0,1,'Ljuvligt ABC pussel i härling pastellfärg'),(3,4,83,0,1,NULL),(4,4,106,0,1,NULL),(21,4,72,0,2,'Ljuvligt ABC pussel i härling pastellfärg'),(22,4,73,0,2,'Ljuvligt ABC pussel i härling pastellfärg'),(23,4,83,0,2,NULL),(24,4,106,0,2,NULL),(48,4,72,0,3,'Gift Cards for Magento'),(49,4,73,0,3,'Gift Cards for Magento'),(50,4,83,0,3,NULL),(51,4,106,0,3,NULL),(52,4,72,0,4,'test'),(53,4,73,0,4,'test'),(54,4,83,0,4,NULL),(55,4,106,0,4,NULL),(74,4,72,0,5,'<h2>Information</h2>\r\n\r\nThis o-neck sweater with long sleeves is the sweater for you that don’t want to wear an oversize one, or simply want a perfect o-neck sweater that you can pair with anything. Beautiful just as it is with jeans and boots or chic tucked into a high-wasted skirt. This style is a must in any wardrobe and of course it is in 100 % cashmere. Knitted in 12 gauge and the model wears a size small and is cm. Available in many different colours perfect for fall and all year around. The model is 174 cm tall and wears a size small.\r\n\r\n<ul>\r\n<li>Worldwide Shipment</li>\r\n<li>Free Returns</li>\r\n<li>Shipped within 72 hours</li>\r\n</ul>'),(75,4,73,0,5,'test01'),(76,4,83,0,5,NULL),(77,4,106,0,5,NULL),(78,4,72,0,6,'test01'),(79,4,73,0,6,'test01'),(80,4,83,0,6,NULL),(81,4,101,0,6,NU