INSERT INTO `cms_block` VALUES (1,'Footer Links','footer_links','\n<ul>\n    <li><a href=\"{{store direct_url=\"about-magento-demo-store\"}}\">About Us</a></li>\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\n<li class=\"last privacy\"><a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy</a></li>\r\n</ul>','2017-02-16 18:01:00','2017-02-16 18:01:02',1),(2,'Footer Links Company','footer_links_company','\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>','2017-02-16 18:01:02','2017-02-16 18:01:02',1),(3,'Cookie restriction notice','cookie_restriction_notice_block','<p>Soft Goat anvӓnder cookies. Genom att fortsӓta pa sidan godkӓnner du anvӓndandet av cookies.</p>','2017-02-16 18:01:02','2017-03-25 22:44:58',1),(4,'contact','contact','<ul class=\"contact-menu\">\r\n<li><a href=\"#\">KONTAKTA OSS</a></li>\r\n<li><a>RETURER &amp; BYTEN</a></li>\r\n<li><a>K&Ouml;P OCH LEVERANSVILLKOR</a></li>\r\n<li><a>PERSONUPPGIFTSPOLICY</a></li>\r\n<li><a>SK&Ouml;TSELR&Aring;D</a></li>\r\n<li><a>PRESS</a></li>\r\n</ul>\r\n<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<p>Prata direkt med en av v&aring;ra kunniga personal</p>\r\n<p><i class=\"fa fa-wechat\">&nbsp;</i>&nbsp;Online</p>\r\n<p class=\"margin-top-15\">Kontakta oss genom formul&auml;ret h&auml;r nedan, vi h&ouml;r av oss inom kort!</p>\r\n<h5 class=\"margin-top-15\">Kontaktformul&auml;r</h5>\r\n{{block type=\'core/template\' name=\'contactForm\' template=\'contacts/form.phtml\'}}</div>\r\n<div class=\"col-sm-7 col-sm-offset-1\">\r\n<h2>PRESSFR&Aring;GOR &amp; BILDER</h2>\r\nPressprover finns att l&aring;na i Soft Goats showroom, Tegn&eacute;rgatan 13. F&ouml;r h&ouml;guppl&ouml;sta bilder samt &ouml;verenskommelse om l&aring;n av pressprover kontakta Sofia Nordblom: sofia@softgoat.com.\r\n<div class=\"margin-top-15\">\r\n<h2>KONTAKTA OSS</h2>\r\nVi vill vara tillg&auml;ngliga f&ouml;r v&aring;ra kunder s&aring; kontakta oss g&auml;rna vid eventuella fr&aring;gor eller funderingar.</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Produktion och marknadsf&ouml;ring:</h2>\r\nEmail: stephanie@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Ekonomi och administration:</h2>\r\nEmail: stephanie@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Fr&aring;gor om din order eller &ouml;vriga fr&aring;gor:</h2>\r\nRing oss g&auml;rna p&aring; 08-410 200 18 vardagar mellan 10-17. Eller maila oss p&aring; info@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Butik, kontor &amp; showroom:</h2>\r\n<p>Soft Goat AB<br />Tegn&eacute;rgatan 13<br />111 40 Stockholm<br />Tel. +46 8 410 200 18</p>\r\n<p>Butikens &ouml;<br />ppettider: Vardagar 10-18<br />L&ouml;rdagar 11-16</p>\r\n</div>\r\n</div>\r\n</div>','2017-03-15 16:41:54','2017-03-15 16:41:54',1),(5,'storlekguide','store','<div class=\"stor-main custom-tabs\">\r\n	<div class=\"main_uper_part_store\">\r\n		<div class=\"storle tab1\" data-toggle=\"collapse\" data-target=\".tab-text1\" ><span><img alt=\"\" src=\"{{media url=\"wysiwyg/icon_no_1.png\"}}\" /></span>\r\n			<h2>Storlekguide</h2>\r\n		</div>\r\n		<div class=\"skot tab2\" data-toggle=\"collapse\" data-target=\".tab-text2\"><span><img alt=\"\" src=\"{{media url=\"wysiwyg/icon_no_2.png\"}}\" /></span>\r\n			<h2>Skotselrad</h2>\r\n		</div>\r\n	</div>\r\n	<div class=\"main_bottom_part_text\">\r\n		<div class=\"text-img1 tab-text1\" style=\"display: none\">\r\n			<div class=\"text\">\r\n				<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s</p>\r\n			</div>\r\n			<div class=\"img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/im1.png\"}}\" /></div>\r\n		</div>\r\n		<div class=\"text-img2 tab-text2\" style=\"display: none\">\r\n			<div class=\"text\">\r\n				<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s</p>\r\n			</div>\r\n			<div class=\"img\"><img alt=\"\" src=\"{{media url=\"wysiwyg/im1.png\"}}\" /></div>\r\n		</div>\r\n	</div>\r\n</div>\r\n','2017-03-21 05:37:40','2017-03-25 22:04:41',1),(6,'Top header link Swedish','threetext','<ul class=\"top-header-menu\">\r\n<li><a href=\"#\">Leverans Inom 72 timmer</a></li>\r\n<li><a href=\"#\">Tidsenligt Design</a></li>\r\n<li><a href=\"#\">Barnvanliga Produkter</a></li>\r\n</ul>','2017-03-22 08:03:15','2017-03-30 02:03:49',1),(7,'Top header link English','threetext','<ul class=\"top-header-menu\">\r\n<li><a href=\"#\">Contemporary Design</a></li>\r\n<li><a href=\"#\">Worldwide Shipments</a></li>\r\n<li><a href=\"#\">Quick delivery</a></li>\r\n</ul>','2017-03-30 01:54:23','2017-03-30 02:03:59',1);
