 this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\n    <ul class=\"disc\">\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n','2017-02-16 18:01:01','2017-02-16 18:01:01',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Privacy Policy','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','<p style=\"color: #ff0000; font-weight: bold; font-size: 13px\">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path=\"general/store_information/name\"}} uses and protects any information\n    that you give {{config path=\"general/store_information/name\"}} when you use this website.\n    {{config path=\"general/store_information/name\"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path=\"general/store_information/name\"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path=\"trans_email/ident_general/email\"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path=\"general/store_information/address\"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class=\"data-table\">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>','2017-02-16 18:01:02','2017-02-16 18:01:02',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Contact','page_full',NULL,NULL,'contact',NULL,'<div class=\"contact-page\">\r\n<div class=\"contact-page-inner\">\r\n<div class=\"container-fluid\">\r\n<div class=\"left-padding-90\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<ul class=\"contact-menu\">\r\n<li><a href=\"#\">KONTAKTA OSS</a>&nbsp;&nbsp;</li>\r\n<li><a>RETURER &amp; BYTEN &nbsp;</a></li>\r\n<li><a>K&Ouml;P OCH LEVERANSVILLKOR&nbsp;</a></li>\r\n<li><a>PERSONUPPGIFTSPOLICY &nbsp;</a></li>\r\n<li><a>SK&Ouml;TSELR&Aring;D &nbsp;</a></li>\r\n<li><a>PRESS</a></li>\r\n</ul>\r\n<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<p>Prata direkt med en av v&aring;ra kunniga personal</p>\r\n<p><i class=\"fa fa-wechat\">&nbsp;</i> Online</p>\r\n<p class=\"margin-top-15\">Kontakta oss genom formul&auml;ret h&auml;r nedan, vi h&ouml;r av oss inom kort!</p>\r\n<h5 class=\"margin-top-15\">Kontaktformul&auml;r</h5>\r\n{{block type=\'core/template\' name=\'contactForm\' template=\'contacts/form.phtml\'}}</div>\r\n<div class=\"col-sm-7 col-sm-offset-1\">\r\n<h2>PRESSFR&Aring;GOR &amp; BILDER</h2>\r\nPressprover finns att l&aring;na i Soft Goats showroom, Tegn&eacute;rgatan 13. F&ouml;r h&ouml;guppl&ouml;sta bilder samt &ouml;verenskommelse om l&aring;n av pressprover kontakta Sofia Nordblom: sofia@softgoat.com.\r\n<div class=\"margin-top-15\">\r\n<h2>KONTAKTA OSS</h2>\r\nVi vill vara tillg&auml;ngliga f&ouml;r v&aring;ra kunder s&aring; kontakta oss g&auml;rna vid eventuella fr&aring;gor eller funderingar.</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Produktion och marknadsf&ouml;ring:</h2>\r\nEmail: stephanie@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Ekonomi och administration:</h2>\r\nEmail: stephanie@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Fr&aring;gor om din order eller &ouml;vriga fr&aring;gor:</h2>\r\nRing oss g&auml;rna p&aring; 08-410 200 18 vardagar mellan 10-17. Eller maila oss p&aring; info@softgoat.com</div>\r\n<div class=\"margin-top-15\">\r\n<h2>Butik, kontor &amp; showroom:</h2>\r\n<p>Soft Goat AB<br /> Tegn&eacute;rgatan 13<br /> 111 40 Stockholm<br /> Tel. +46 8 410 200 18</p>\r\n<p>Butikens &ouml;<br />ppettider: Vardagar 10-18<br /> L&ouml;rdagar 11-16</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2017-02-20 22:17:38','2017-03-20 06:33:32',0,0,NULL,NULL,NULL,NULL,NULL,NULL),(8,'News','one_column',NULL,NULL,'news',NULL,'<div class=\"news-page\">\r\n<div class=\"news-page-inner\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">{{block type=\"catalog/product_list\" column_count=\"3\" category_id=\"3\" template=\"catalog/product/list.phtml\"}}</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2017-02-20 22:50:44','2017-02-20 23:37:49',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(9,'demo home','page_full',NULL,NULL,'demo-home',NULL,'{{widget type=\"ves_blockbuilder/widget_page\" block_id=\"8\" code=\"demo-home\"}}','2017-03-10 17:29:39','2017-03-15 16:31:20',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(10,'kontakt','custom_pagebuilder_page_two',NULL,NULL,'kontakt',NULL,'{{widget type=\"ves_blockbuilder/widget_page\" block_id=\"10\" code=\"kontakt\"}}','2017-03-15 16:39:12','2017-03-17 06:04:09',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Reward Policy','two_columns_left','reward policy','reward policy','rewardpoints-policy','Reward Policy','<div>\n    {{block type=\"rewardpoints/template\" template=\"rewardpoints/policy/earn.phtml\" }}\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} EXCHANGE RATES</strong>\n        <br>\n        <p class=\"rewardpoints-title-content\">The value of {{block type=\"rewardpoints/welcome_name\"}} is determined by an exchange rate of both currency spent on products to {{block type=\"rewardpoints/welcome_name\"}}, and an exchange rate of {{block type=\"rewardpoints/welcome_name\"}} earned to currency for spending on future purchases.</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">REDEEM {{block type=\"rewardpoints/welcome_name\"}}</strong>\n        <br>\n        <p class=\"rewardpoints-title-content\">You can redeem your {{block type=\"rewardpoints/welcome_name\"}} at checkout. If you have accumulated enough {{block type=\"rewardpoints/welcome_name\"}} to redeem them you will have the option of using {{block type=\"rewardpoints/welcome_name\"}} as one of the payment methods. The option to use {{block type=\"rewardpoints/welcome_name\"}}, as well as your balance and the monetary equivalent this balance, will be shown to you in the Payment Method area of the checkout. Redeemable {{block type=\"rewardpoints/welcome_name\"}} can be used in conjunction with other payment methods such as credit cards, gift cards and more.</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} MINIMUMS AND MAXIMUMS</strong>\n        <p class=\"rewardpoints-title-content\">{{block type=\"rewardpoints/welcome_name\"}} may be capped at a minimum value required for redemption. If this option is selected you will not be able to use your {{block type=\"rewardpoints/welcome_name\"}} until you accrue a minimum number of {{block type=\"rewardpoints/welcome_name\"}}, at which {{config path=\"rewardpoints/general/point_name\"}} they will become available for redemption.\n</br>{{block type=\"rewardpoints/welcome_name\"}} may also be capped at the maximum value of {{block type=\"rewardpoints/welcome_name\"}} which can be accrued. If this option is selected you will need to redeem your accrued {{block type=\"rewardpoints/welcome_name\"}} before you are able to earn more {{block type=\"rewardpoints/welcome_name\"}}.\n</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">MANAGE YOUR {{block type=\"rewardpoints/welcome_name\"}}</strong>\n        <p class=\"rewardpoints-title-content\">You have the ability to view and manage your {{block type=\"rewardpoints/welcome_name\"}} through your <a href=\"\">Customer Account</a>. From your account you will be able to view your total {{block type=\"rewardpoints/welcome_name\"}} (and currency equivalent), minimum needed to redeem, whether you have reached the maximum {{block type=\"rewardpoints/welcome_name\"}} limit and a cumulative history of {{block type=\"rewardpoints/welcome_name\"}} acquired, redeemed and lost. The history record will retain and display historical rates and currency for informational purposes. The history will also show you comprehensive informational messages regarding {{block type=\"rewardpoints/welcome_name\"}}, including expiration notifications.\n</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} EXPIRATION</strong>\n        <p class=\"rewardpoints-title-content\">{{block type=\"rewardpoints/welcome_name\"}} can be set to expire. Points will expire in the order form which they were first earned.</p>\n        <strong>Note:</strong>\n        <ul class=\"rewardpoints-dashboard-ul\">\n            <li>Points can be used as store credit in our system only. Redeeming to cash is not allowed.</li>\n            <li>You can sign up to receive email notifications each time your balance changes when you either earn, redeem or lose {{block type=\"rewardpoints/welcome_name\"}}, as well as point expiration notifications. This option is found in the {{block type=\"rewardpoints/welcome_name\"}} section of the My Account area.</li>\n        </ul>\n    </div>\n</div>\n\n','2017-03-17 06:17:36','2017-03-17 06:17:36',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Reward Welcome Page','two_columns_left','reward welcome page','reward welcome page','rewardpoints-welcome','WELCOME TO OUR REWARD PROGRAM!','<div>\n    <div class=\"rewardpoints-dashboard-list\">\n        Every of your activity on our site is appreciated & rewarded. The more you spend, the more you save. Enroll now to begin earning greater benefits! \n        If you are already a member, log in to view your Reward Balance.\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title rewardpoints-title-upercase\">BENEFITS OF {{block type=\"rewardpoints/welcome_name\"}} FOR REGISTERED CUSTOMERS</strong>\n        <p class=\"rewardpoints-title-content\"><img src=\"{{media url=\"rewardpoints/default/welcome.png\"}}\" alt=\"{{block type=\"rewardpoints/welcome_name\"}} Welcome\" /></p>\n\n        <p class=\"rewardpoints-title-content\">\n            Once you register you will be able to earn and accrue {{block type=\"rewardpoints/welcome_name\"}}, which are then redeemable at time of purchase towards the cost of your order. Rewards are an added bonus to your shopping experience on the site and just one of the ways we thank you for being a loyal customer. You can easily earn points for certain actions you take on the site, such as making purchases.\n        </p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        {{block type=\"rewardpoints/account_dashboard_earn\" template=\"rewardpoints/account/dashboard/earn.phtml\"}}\n        {{block type=\"rewardpointsrule/account_dashboard_earn\" template=\"rewardpointsrule/account/dashboard/earn.phtml\"}}\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        {{block type=\"rewardpoints/account_dashboard_spend\" template=\"rewardpoints/account/dashboard/spend.phtml\"}}\n        {{block type=\"rewardpointsrule/account_dashboard_spend\" template=\"rewardpointsrule/account/dashboard/spend.phtml\"}}\n    </div>\n</div>','2017-03-17 06:17:38','2017-03-17 06:17:38',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Affiliate','two_columns_left',NULL,NULL,'affiliate-home','Welcome To Our Affiliate Network!','\n<p>Affiliate programs are common throughout the Internet and offer website owners an additional way to spread the word about their websites. Among others, our program is free to join, easy to sign up and requires no technical knowledge! As our affiliates, you will generate traffic and sales for our website and receive attractive commissions in return.</p>\n<h3>How Does It Work?</h3>\n<p>When you join our affiliate program, you will be supplied with a range of banners and text links to place wherever you like. When a user clicks on one of your links, they will be brought to our website and their activities will be tracked by our affiliate program. Once this user completes a purchase, you earn commission!</p>\n<h3>Real-Time Statistics and Reports!</h3>\n<p>Log in anytime to check your performance with data of sales, traffic generated and your commission balance.</p>','2017-03-17 06:58:29','2017-03-17 06:58:29',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Terms','custom_pagebuilder_page_two',NULL,NULL,'terms',NULL,'<h2>Comming Soon......</h2>','2017-03-22 07:53:20','2017-03-22 07:53:20',1,0,NULL,NULL,NULL,NULL,NULL,NULL);
